    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

## Introdução

Ao criar um currículo, é necessário inserir informações sobre os **objetivos de carreira, graduação, habilidades, conquistas e conhecimento técnicos**, e que são partes comuns para todas as profissões. Entretanto, alguns pontos devem ser levados em conta ao construir um currículo dedicado para a **área de dados** e vamos falar sobre isso.
---

## Empresas buscam profissionais com objetivos em mente

Na última aula, apresentamos as principais habilidades que um cientista de dados deve possuir - **conhecimento em programação, estatística/matemática e conhecimento do setor** - além dos cargos que uma empresa necessita para um time de dados - **Engenheiro de Dados, Analista de Dados, Especialista em Machine Learning e Cientista de Dados** - Essa informações desempenham um papel crucial no momento de alinhar as expectativas de uma vaga que uma empresa solicita. 

E uma vez que se tenha entendido essa questão de alinhamento com a empresa, fica muito mais **fácil** direcionar o tempo de aprendizado, e o conteúdo do currículo, com a finalidade de atingir o objetivo da empresa.

---
## Empresas buscam profissionais com objetivos em mente

Há diferentes empresas com diversas finalidades, é possível que determinada organização procure cientistas de dados que possuem conhecimento mais **generalistas** dessas três habilidades ou procure cientistas de dados que possuem **conhecimentos mais específicos**.

Com essa questão em mente, é sempre importante manter-se alerta para qual o **interesse da empresa no profissional** de forma que prepare um **currículo ideal** para isso.

---
## Como evidenciar o seu conhecimento para recrutadores?

Outra questão é a forma de **apresentação do conhecimento**. Colocar que possui profundo conhecimento em programação ou construção de modelos de Machine Learning **não é o bastante para que um recrutador possa se interessar pelo seu currículo**. Antes de tudo, é necessário **provar** que se possui determinado conhecimento, principalmente se for **prático**. E uma ótima forma de demonstrar é construindo um **portfolio**.

---
## Como evidenciar o seu conhecimento para recrutadores?
### Portfólio

A construção de um portfólio é necessário para que se tenha uma forma de demonstrar que já possui a habilidade prática para o recrutador, mas, **como construir um portfolio e mostrar para os recrutadores o seu conhecimento?**

Dados para aplicações no mundo não faltam, entretanto, muitos podem ficar perdidos em relação a essa etapa. **Onde arrumar dados? Como aplicar? Qual o lugar que devo criar os códigos para mostrar ao recrutador?**

Para conseguir dados, é possível obter diversos *datasets* disponíveis na internet, dados públicos e governamentais, dados de pesquisas, dados que empresas disponibilizam. Aqui na **Análise Macro**, ensinamos os alunos a **coletar e tratar dados sobre economia e finanças**. Nossos alunos conseguem realizar essa etapa com maestria. 

Através dos dados coletados, não se atenha em aplicar os conhecimentos obtidos através dos cursos da **Análises Macro**. É possível que se tenha dificuldades ou incorra em erros, porém, é uma etapa natural e que na medida que se pratica, mais fácil fica.

---
## Como evidenciar o seu conhecimento para recrutadores?
### Portfólio
#### Github

  .pull-left[
E como **mostrar os códigos?** A forma mais comum hoje em dia é criar uma conta na plataforma **[Github](https://github.com/)** de forma que consiga **compartilhar** os códigos para os recrutadores. 

O **[Github](https://github.com/)** é uma plataforma de hospedagem de códigos e arquivos com controles de versão. Não somente é possível compartilhar códigos com diferentes pessoas, mas também trabalhar em um código junto com uma equipe, controlando mudanças de qualquer lugar do mundo.
]
  .pull-right[
&lt;img src=&quot;data:image/png;base64,#rmd/github.png&quot; width=&quot;130%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

---
## Como evidenciar o seu conhecimento para recrutadores?
### Portfólio
#### Kaggle

  .pull-left[
Uma plataforma que merece destaque também é o **[Kaggle](https://www.kaggle.com/)**. O Kaggle é uma plataforma que visa criar uma comunidade com a finalidade de criar **competições de Ciência de Dados** e também oferecer diversos *datasets* para que qualquer usuário possa **aplicar o conhecimento nos dados e compartilhar com a comunidade do site**.

]
  .pull-right[
&lt;img src=&quot;data:image/png;base64,#rmd/kaggle.png&quot; width=&quot;130%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

---
## Como evidenciar o seu conhecimento para recrutadores?
### Portfólio
#### Linkedin
  .pull-left[
Obviamente, o melhor local para chamar a atenção de recrutadores e poder compartilhar os repositórios com os códigos, bem como currículo, é a rede social **[Linkedin](https://www.linkedin.com/)**.

Além do compartilhamento de conhecimentos práticos, é interessante também **criar resumos de conhecimentos teóricos** e compartilhar como forma de mostrar que se possui o domínio na área de estudo.
